INSERT INTO `wechat_send_message` VALUES ('1143', '', '0', '标题：场面太尴尬,糗的想骂娘\n1、5毛硬币大小的药片，楼主用了三碗水还吞不下去，卡在喉咙里上不去下不来难受的眼泪都出来了，后来又大喝一口水让水把药片融化吞去了，这时才发现药瓶上赫然写着三个大字：咀嚼片！！！\r\n2、“老公，把这个商标贴你到你内裤里面。”\r\n“贴这有什么用？”\r\n“你不懂，电视上说了，这个商标具有防萎功能，咱试试看效果啥样！”\r\n“尼玛。。。”\r\n3、下班回到家，在他家照看三岁儿子的岳母娘脸沉得能掉下水来。\r\n他悄悄的问媳妇啥状况，媳妇说：“昨晚和我们一起睡的儿子，午睡时一屁股坐到他外婆腰上，上下摆动，嘴里念念有词，啊，老公，我不行了！”\r\n4、妈：女儿这么大了，也没个男朋友，真让人捉急。\r\n爸：别瞎操心了。\r\n妈不解。\r\n爸：你女儿在家里一个礼拜不洗一次澡，天天回来身上还有沐浴露香味。看来在外面可是没少洗啊……', '2016-04-14 13:33:32', '', 'gh_152315985db4', '', '0', 'text', '', '', '0', '', 'ohwjvw1QPmm0YLy3yKhjGYg4qS_g');
INSERT INTO `wechat_send_message` VALUES ('1144', '', '0', '标题：听话的消费者\n逛街看见街边两个卖葡萄的摊位，于是走过去问价，一个说四块一斤，一个说四块五一斤。\r\n心想：四块五的应该好一些。于是来到四块五的葡萄摊位问老板能不能便宜点。老板酷酷的说：“一分钱一分货，我这不能便宜了，要便宜的请去隔壁。”我本来打算他便不便宜我都买他的。听他这么一说我真走向隔壁的摊位。\r\n隔壁的老板高兴地接待了我说：“妹子，我这葡萄好吃，你就是称个十斤到时一尝，也不一定吃得够。”\r\n“好，听你的，就给我来十斤。”\r\n老板一听，眉开眼笑立马给我装了十斤的葡萄。\r\n提着沉甸甸的葡萄，我冲隔壁的老板笑笑说：“老板，谢谢你的建议啊！”\r\n呵呵。\r\n', '2016-04-14 13:33:35', '', 'gh_152315985db4', '', '0', 'text', '', '', '0', '', 'ohwjvw1QPmm0YLy3yKhjGYg4qS_g');
INSERT INTO `wechat_send_message` VALUES ('1145', '', '0', '标题：有如此内涵见地,唯熟尔\n1、女友问：老公，怎么评价女人的胸大？\r\n男说：难以把握。\r\n女友又问：那我的怎么样？\r\n男说：难以拿捏。\r\n2、今天逗一女同事玩，逗着逗着她生气了，竟然对我竖起了中指，作为一个充满了正义感的男人，当时就不乐意了，回了她一句：怎么？拿你男朋友出来吓我啊。\r\n3、天凉了，我开心的跟闺蜜说：“又到了一年一季不穿罩罩也不用担心走光的季节了。”\r\n闺蜜说：“是到了一次穿两个罩罩也不会被看出来的季节了！”\r\n4、女神：“看看你们男人，多花心，啊！看看人家孙悟空，仙女摆在面前都没兴趣。”\r\n屌丝：“切，你放几只母猴试试。”\r\n5、男：“你为什么不愿意去做老师呢！工作稳定又受人尊重。”\r\n女：“你TM姓苍试试！”\r\n6、今天开会，老板强调我们产品的创新问题，我突发奇想的问同事：“产品创新的初衷都是为了方便人们的生活，有没有哪一种是为了不方便的？”\r\n同事想了一下，叹了口气：“马赛克！”\r\n', '2016-04-14 13:33:38', '', 'gh_152315985db4', '', '0', 'text', '', '', '0', '', 'ohwjvw1QPmm0YLy3yKhjGYg4qS_g');
INSERT INTO `wechat_send_message` VALUES ('1146', '', '0', '标题：爆笑,不二一点,都不好意思跟人打招呼\n1、老师对着一群同学吼道：“没写作业的多给我站起来！”\r\n话音刚落，刷刷刷站起几个人，老师一指门口，继续骂道：“都给我滚出去！”\r\n几个人低着头默默走了出去，老师见状面露微笑，走到马桶边上边脱裤子边自语道：“一点也不尊重老师，见老师上厕所也不知道让个位置。”\r\n2、刚看到一小孩吃着棒棒糖背着书包，蹦蹦跳跳的可能要回家。我走过去问道：“小朋友，放学回家呀！就你自己一个人吗？”\r\n小朋友：“对呀，今天我爸爸没来接我。” \r\n我：“哈哈，天助我也！TMD，把你嘴里的棒棒糖拿来，不然老子我打你。” \r\n3、地铁人满为患，可那些女孩宁愿站着也不愿意坐我身边的空位。直到我到站了也没人来坐。“难道因为我的帅让她们小鹿乱撞了而不敢靠近我？下次是不是应该戴个口罩出门？”\r\n我一边把袜子穿好准备下车一边反思。\r\n4、最近很多人说要和土豪做朋友。不过平心而论，就算和土豪成了朋友又怎么样呢？\r\n吃人嘴软拿人手短，老是占人家便宜，就得付出尊严为代价，就得唯唯诺诺，就得低人一等。\r\n你能接受在这种情况下得来的便宜吗？反正我能，土豪请和我做朋友。。。', '2016-04-14 13:34:17', '', 'gh_152315985db4', '', '0', 'text', '', '', '0', '', 'ohwjvw1QPmm0YLy3yKhjGYg4qS_g');
INSERT INTO `wechat_send_message` VALUES ('1147', '', '0', '标题：2B老师,教学水平高\n1、医学院外科老师说：所谓无菌和干净的区别，就是你把一砣屎放高压锅里蒸一个小时，它就是无菌的了，但是你说它干不干净呢？\r\n2、一小学生迟到了，老师问：你为什么迟到了，\r\n他答：我捡到了一个钱包里面有好几千块钱，我去找Pol.ice了，Pol.ice叔叔高兴地带我去吃肯德基了。\r\n老师：下次捡钱包记得交给老师，老师带你去游乐园。\r\n3、课堂上听课的人很少，基本上都在玩QQ、微信、游戏什么的。\r\n老师突然说：同学们注意一下，下课把手机交上来，你们手机的剩余电量就是你们期末考试的分数!\r\n4、上体育课，男女生各分二排，轮流练站姿。\r\n轮到女生站男生评寸，体育老师喊口令：立正，挺胸。\r\n个别女生因怕羞不太好意思挺起胸来，结果老师说：哦，没胸？你可以不挺。\r\n全班笑成一片……\r\n  ', '2016-04-14 13:34:25', '', 'gh_152315985db4', '', '0', 'text', '', '', '0', '', 'ohwjvw1QPmm0YLy3yKhjGYg4qS_g');
INSERT INTO `wechat_send_message` VALUES ('1148', '', '0', '标题：说话要当心,不然老婆和你拼了\n            \n1、和老公大吵了一架！\r\n老公：你看你气的，脸红的跟苹果似的！\r\n老娘以为他良心发现想要道歉了，只听他接着说：真是一副欠削的样子！\r\n尼玛，老娘和你拼了！\r\n2、早上和老公在床上腻歪，我对他说：老公看着我，说我真美！\r\n老公闭着眼说了句：你真美！\r\n我问：为什么不看着我说？\r\n他说：我不能睁眼说瞎话！\r\n3、本人微胖，今天和老公要去朋友家吃饭，路过火车站，我故意装失忆问老公：你是谁啊，要带我去哪里？\r\n老公看了看我说：带你去好玩的地方呀。\r\n我说：你是不是要拐卖我呀？\r\n老公说：是呀，你怎么知道的？\r\n我得意的问：你打算把我卖多少钱啊？\r\n老公笑笑说：这得论斤称啊！\r\n尼妹，我保证不打死你～\r\n4、老婆：“看，又打死了一只蚊子，这蚊子怎么喜欢盯在我身上一动不动？”\r\n老公笑道：“它是在发呆，这么多大一坨肥又嫩的肉，从来哪里下口啊？！”\r\n“滚！。。。”', '2016-04-14 13:34:37', '', 'gh_152315985db4', '', '0', 'text', '', '', '0', '', 'ohwjvw1QPmm0YLy3yKhjGYg4qS_g');
