INSERT INTO `wechat_send_message` VALUES ('1173', '', '0', '标题：曲线救国\n            \n一班中国科学家鼓捣出了时空传送技术，不过只能单向传送不超过10克的物品到七十八年前的中国！\r\n科学家都爱国啊，他们想：那时候抗日战争开启，要想办法帮中国轻易赢得战争啊，那该怎么办？\r\n传送核武器什么的实在不可行，最终商量良久，终于决定，将电视里手撕鬼子的的画面弄成黑白相片，弄成一册传送过去。\r\n想来日本鬼子看到这些相片，还不直接吓尿退回日本啊。', '2016-04-14 20:28:21', '', 'gh_152315985db4', '', '0', 'text', '', '', '0', '', 'ohwjvw1QPmm0YLy3yKhjGYg4qS_g');
INSERT INTO `wechat_send_message` VALUES ('1174', '', '0', '标题：爆笑顽皮小精灵\n            \n1、明宝宝被他妈狠狠的揍了，因为明宝宝认为只有他妈妈才穿胸罩，然后就把周围邻居家晒得胸罩全部用杆子挑回了家。。。\r\n别人上门要他还死护着胸罩说：都是我妈的！！！！！！\r\n2、家有儿女，女儿六岁，儿子四岁。\r\n中午饭，偶做红烧鱼为背景： 儿子：“我最喜欢吃鱼。” \r\n女儿：“我不喜欢吃鱼。”\r\n儿子：“吃鱼聪明，我比你聪明。”\r\n女儿：“你聪明，那我考你，100+100等于多少？”\r\n儿子：“我还没吃够呢，等我再吃两年告诉你。”\r\n3、女幼师一枚，刚开学时，因为小班孩子刚上幼儿园比较激动会哭……\r\n有一孩子哭了好久就拉着我说：老师，我都哭累了，我妈妈怎么还不来？ \r\n4、外甥犯了错误，被我姐海扁了一顿，然后问他：下次还敢不敢？\r\n外甥哭着说：不敢了，再犯我就是狗娘养的。。。\r\n然后外甥又被一顿海扁… \r\n5、小侄女今天拿着花生问我：“姑姑，你猜我的花生是咬开的还是剥开的？”\r\n“咬的？”\r\n“错”\r\n“剥的？？”\r\n“错”\r\n“那怎么开的？？？”\r\n“我是砸开的！”', '2016-04-14 20:29:05', '', 'gh_152315985db4', '', '0', 'text', '', '', '0', '', 'ohwjvw1QPmm0YLy3yKhjGYg4qS_g');
