INSERT INTO `wechat_send_message` VALUES ('1176', '', '0', '标题：幽默青年的欢乐逗\n            \n1、一女在发呆中，他男神突然走过来说：我要让你忘不了我。\r\n女羞涩，低声：真的吗？\r\n男神：真的，借我点钱用一下。\r\n2、我的女朋友是个很没骨气的人，每次和我吵架都是她先道歉：“对不起，我们分手吧。”\r\n3、昨晚在路边吃馄饨，收钱的是一漂亮妹子。\r\n我给她20元，她找给我15元。\r\n我盯着妹子看得入神了，一直看，妹子又给我30元，我还看，妹子又给我50元，我继续看，妹子突然说道：“大哥，你刚才到底给我多少钱啊？”\r\n4、女朋友要和我分手，为了拯救这段感情，我把她的素颜照发到了朋友圈。\r\n果然，她不仅主动联系了我，还信誓旦旦地对我说：“我跟你没完！”\r\n5、男：“美女，别抽烟了，抽烟对身体不好，影响人的寿命”\r\n女：“我奶奶活了一百多岁？。”\r\n男：“你奶奶抽烟？”\r\n女：“不，她只是从来不管别人闲事。”\r\n6、多年前，女友跟我分手，给我留下一张字条：“145×154÷D2:1”这些年我翻遍所有数学书籍都没能找到答案，不过我相信只要解开字条，她就能再回到我身边。\r\n前不久偶遇她，我把已经破碎的字条塞到她手中，含泪望着她，她看着我笑了笑：“这么多年你还是没变！“一事无成，一无是处的2B！”', '2016-04-14 20:33:18', '', 'gh_152315985db4', '', '0', 'text', '', '', '0', '', 'ohwjvw1QPmm0YLy3yKhjGYg4qS_g');
