INSERT INTO `wechat_send_message` VALUES ('1373', '', '0', '搜索周边：美容\n                    \n    名称：臭美国际美容中心\n    地址：广东省深圳市南山区大冲华润城商务中心C座6楼(罗宝线-高新园站B出口)\n    电话：0755-86560111; 15013461936\n    距离：612.84米\n                    \n    名称：琉璃时光SPA国际连锁机构(博海名苑店)\n    地址：广东省深圳市南山区高新南环路8-5\n    电话：0755-86288854\n    距离：1313.44米\n                    \n    名称：麟雅专业美容养生馆\n    地址：广东省深圳市南山区高新南环路46-7\n    电话：0755-86162706\n    距离：1319.68米\n                    \n    名称：阳光新贵美容养生馆\n    地址：广东省深圳市南山区高新南环路46-5\n    电话：0755-23570179; 0755-23705967\n    距离：1327.2米\n                    \n    名称：克丽缇娜(白石路店)\n    地址：广东省深圳市南山区沙河东路世纪村三期6栋110号商铺(沙河高尔夫球场对面)\n    电话：0755-26767819\n    距离：1380.79米\n\n\n注：以4分钟前的位置计算', '2016-04-27 15:21:47', '', 'gh_152315985db4', '', '0', 'text', '', '', '0', '', 'ohwjvw1QPmm0YLy3yKhjGYg4qS_g');
INSERT INTO `wechat_send_message` VALUES ('1374', '', '0', '标题：看了就想笑的爆冷笑话\n            \n1、和朋友外出游山，结果被大雨困在了半山腰的寺庙里，幸亏方丈好心收留我们住宿。\r\n知道朋友嘴贱，我提醒他：“你可千万别在方丈前提什么秃子、梳子之类的词！”\r\n“你放心。”朋友冲我点点头，然后对方丈说：“方丈大师，您看我们都淋湿了，您这里有吹风机吗？”\r\n2、到底是怎样的侠客创造了刀削面？\r\n这是历史留给我们整个民族的谜题。\r\n这简单冰冷的三个字却有武器，有招数，有死敌，蕴含了武林恩怨的所有基本要素，从容不迫的气度中有风雨不透的杀气与狠辣。\r\n吃一碗刀削面，一碗千年不灭的刀削面，便如同吃一碗快意恩仇侠骨柔情的江湖。\r\n3、越王闻吴国要建水军，便不顾反对的前去攻打，结果大败佯装投降被俘。\r\n三年饱受屈辱，每日晚上睡觉不用褥，只铺些柴草，又在屋里挂了一只苦胆，他不时会尝尝苦胆的味道。\r\n巡逻的兵见了，总会说：这越王够贱的啊，都这熊样了还特么不忘舔胆补身子。\r\n4、A：明明都是生命，你为啥不吃鸡却吃鸡蛋呢？\r\nB：因为鸡知道疼但鸡蛋不知。\r\nA：你又不是蛋，怎么知道不疼？\r\nB：蛋就是不疼！\r\nA：蛋不疼怎会有“蛋疼”这个词？\r\n5、凤姐睁开眼，昨夜的醉意已经褪去。 床是自己的，家是自己的。 陌生男人已经穿好衣服正要开门而去。\r\n凤姐突然有些忧伤，即脱口而出：我还不知道你的名字呢。\r\n男人回头，温柔笑道：就叫我群主吧！', '2016-04-27 15:22:15', '', 'gh_152315985db4', '', '0', 'text', '', '', '0', '', 'ohwjvw1QPmm0YLy3yKhjGYg4qS_g');
